local AlBattleEventMessage = BaseClass("AlBattleEventMessage", SFSBaseMessage)
local base = SFSBaseMessage

local function OnCreate(self, allianceId, startTime, page)
    base.OnCreate(self)
    self.sfsObj:PutUtfString("allianceId", allianceId)
    self.sfsObj:PutLong("startTime", startTime)
    self.sfsObj:PutInt("page", page)
end

local function HandleMessage(self, t)
    base.HandleMessage(self, t)
    if t["errorCode"] ~= nil then
        UIUtil.ShowTipsId(t["errorCode"])
        return
